import "./Header.css";

import Logo from "../Logo/Logo";
import Background from "../Background/Background";

const Header = () => {
  return (
    <div className="Header container-fluid">
      <Background />
      <Logo />
      <div className="d-flex flex-column flex-sm-row justify-content-center mt-4"></div>
    </div>
  );
};

export default Header;
